window.bookSummaryJSON = "<p>From the voice of a generation: the most highly anticipated autobiography of the year, and the story of a man who...</p> <ul> <li>...wanted The Who to be called The Hair. </li> <li>...wanted to be a sculptor, a journalist, a dancer, and a graphic designer.</li> <li>...became a musician, composer, librettist, fiction writer, literary editor, sailor.</li> <li>...smashed his first guitar onstage, in 1964, by accident.</li> <li>...invented the Marshall stack, feedback, and the concept album.</li> <li>...inspired Jimi Hendrix's pyrotechnical stagecraft.</li> <li>...is partially deaf in his left ear.</li> <li>...stole his windmill guitar playing from Keith Richards.</li> <li>...followed Keith Moon off a hotel balcony into a pool and nearly died.</li> <li>...did too much cocaine and nearly died.</li> <li>...drank too much and nearly died.</li> <li>...detached from his body in an airplane, on LSD, and nearly died.</li> <li>...was embroiled in a tabloid scandal that has dogged him ever since.</li> <li>...planned to write his memoir when he was 21.</li> <li>...published this book at 67.</li> </ul>"; 
